import React from 'react';
import { Image } from 'react-native';
import { IconButton } from 'react-native-paper'
import { createStackNavigator } from '@react-navigation/stack';
import Home from '../Screens/Home/Home';
import Alcancia from '../Screens/Alcancia/Alcancia';
import DonacionEmpresas from '../Screens/Alcancia/DonacionEmpresas';
import DonacionUsuario from '../Screens/Alcancia/DonacionUsuario';
import Bono from '../Screens/Bono/Bono';
import { Ionicons, FontAwesome5, Entypo, MaterialCommunityIcons } from "@expo/vector-icons";


const Stack = createStackNavigator();

export default function StackNavigation(props) {

    const buttonLeft = () => {
        return (
            <IconButton
                icon='menu'
                onPress={() => props.navigation.openDrawer()}
            />
        )
    }
    const buttonRight = () => {
        return (
            <Image
                source={require('../../../assets/logo_jornadas.png')}
                style={{
                    width: 200,
                    resizeMode: 'contain',
                    height: 50,
                    marginRight: -20,
                }}
            />
        )
    }

    Home.navigationOptions = {
        drawerIcon: () => {
            return <Ionicons name="ios-home" size={25} color='#F5C300' />;
        },
    };

    return (
        <Stack.Navigator >
            <Stack.Screen
                name="Home"
                component={Home}
                options={{ headerLeft: () => buttonLeft(), headerRight: buttonRight, drawerIcon: () => <Ionicons name="ios-home" size={25} color='#F5C300' /> }}
            />
            <Stack.Screen
                name="Alcancia"
                component={Alcancia}
                options={{ headerLeft: () => buttonLeft() }}
            />
            <Stack.Screen
                name="Donacion Empresas"
                component={DonacionEmpresas}
                options={{ title: 'Donacion Empresas', headerLeft: () => buttonLeft() }}
            />
            <Stack.Screen
                name="Donacion Personas"
                component={DonacionUsuario}
                options={{ title: 'Donacion Usuarios', headerLeft: () => buttonLeft() }}
            />
            <Stack.Screen
                name="Bono"
                component={Bono}
                options={{ title: 'Bono', headerLeft: () => buttonLeft() }}
            />
        </Stack.Navigator>
    )
}
